* расширение возможностей обобщённого программирования;
* стандартизация методов параллельной обработки;
* доработка средств безопасного программирования, таких как проверки и безопасные преобразования типов, проверка условий и т. д.

Чтобы понять, как это работало, рассмотрим несколько примеров:
* немецких колонистов полностью освободили от уплаты налогов государству и других обязанностей;
* для евреев ввели черту оседлости;
* украинское и белорусское население на территории бывшей Речи Посполитой сначала совсем не платило подушный налог, а потом платило его в меньшем размере — половину от обычного.
